It’s December 1st and that means our girl Crispy is back!!! As much as I fuss over her, I’m going to be so so sad when the magic of our Elf is a thing of the past so while I’ve got the time I try my best to create as much magic around our Elf’s return as possible. Our Elf Crispy’s purpose from the beginning has been to teach the girls about the real reason for the season. Gifts and Santa are great but my children will always know that Jesus is the reason all this magic exists 🙌🏾 

This year Crispy added to their collection of @cuddleandkind dolls!! The gift that helps feed children in need ❤️ 

Another plus to this season of the Elf is I don’t have to beg the girls to get up in the morning 🤣 They are always on a quest to find her!

