Crispy is BACK!!! And so is the extra special magic we get to create for our kids this season! Our Elf always comes with fun but never without teaching the girls about the REAL Christmas magic that is Jesus 🪄

It’s all fun and games until you forget to move them 😩 And though I may sometimes curse Crispy at night when I’m up until 1am on Pinterest looking for the next day’s adventures, I LOVE seeing my girls run around the house looking for her. This is our 7th year with Crispy and I’m sure next year I’ll have some help from Noelle to keep creating the magic for her sisters 🥹 

So here’s to a season filled with fun with your Elves 🎄 No matter how BIG or small you go isn’t what matters, it’s the time you’re taking to fill your children with memories that will last them a lifetime. Ok bye, I’m about to go cry in the car, this damn Elf 😩😭😭😭 #elfontheshelf #elfmovie #christmashumor #christmasmagic 

